%[text] # Exercise 2: Your Personal Carbon Impact Story
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] In Exercise 1, you built a transport emissions calculator. Now it's time to tell YOUR complete carbon story, with all emissions sources, regional context, and data visualizations that reveal where YOUR impact comes from.
%[text] By the end of this exercise, you'll have answered:
%[text] 1. What's my total annual carbon footprint?
%[text] 2. How does it compare to my region and the world?
%[text] 3. Where does my impact come from? (Transport? Home? Food? Digital?)
%[text] 4. What makes my region different? (Grid, infrastructure, lifestyle)
%[text] 5. Where can I make the biggest difference? \
%[text] This is your data story, contextualized globally but personalized locally.
%[text] ### Part 1: Set Your Regional Context
%[text] Your geography determines your baseline carbon intensity. Different regions have vastly different carbon profiles due to:
%[text] - Electricity grid mix (coal vs. hydro vs. solar)
%[text] - Transportation infrastructure (car-dependent vs. transit-rich)
%[text] - Climate (heating/cooling needs)
%[text] - Economic development stage
%[text] - Cultural consumption patterns \
  %[control:button:697f]{"position":[1,2]}

% Load regional context data
regionalData = readtable('../data/regionalAverages.csv');

optionsRegion = regionalData.Region;
%%
%[text] **Select Your Region**

myRegion = optionsRegion(11); %[control:dropdown:0ae1]{"position":[12,29]}

% TODO: Update this with YOUR location
% myRegion = 'USA';  % Options: 'USA', 'Europe', 'Asia', 'China', 'India', 
                   %          'Norway', 'Brazil', 'Global', etc.


myRegionalContext = regionalData(strcmp(regionalData.Region, myRegion), :) %[output:67b4bc45]
%[text] **Visualize: How Your Region Compares Globally**

% Load global comparison data
globalComparison = readtable('../data/regionalAverages.csv');

figure('Name', 'Global Carbon Context', 'Position', [100 100 1200 500]); %[output:93a0347f]

% Subplot 1: Grid Carbon Intensity by Region
subplot(1,3,1) %[output:93a0347f]
regions = globalComparison.Region;
gridIntensity = globalComparison.GridIntensity_gCO2_per_kWh;

% Highlight your region
colors = repmat([0.7 0.7 0.7], length(regions), 1);
myIdx = strcmp(regions, myRegion);
colors(myIdx, :) = [0.2 0.6 0.8];  % Blue for your region

barh(categorical(regions), gridIntensity, 'FaceColor', 'flat', 'CData', colors); %[output:93a0347f]
xlabel('Grid Carbon Intensity (g CO₂/kWh)'); %[output:93a0347f]
title('Electricity Grid Emissions by Region'); %[output:93a0347f]
grid on; %[output:93a0347f]

% Subplot 2: Per-Capita Total Emissions
subplot(1,3,2) %[output:93a0347f]
perCapita = globalComparison.PerCapita_Total_Tons;
colors = repmat([0.7 0.7 0.7], length(regions), 1);
colors(myIdx, :) = [0.2 0.6 0.8];

barh(categorical(regions), perCapita, 'FaceColor', 'flat', 'CData', colors); %[output:93a0347f]
xlabel('Per-Capita Emissions (tons CO₂/year)'); %[output:93a0347f]
title('Total Emissions by Region'); %[output:93a0347f]
xline(mean(perCapita), '--r', 'Global Average', 'LineWidth', 2); %[output:93a0347f]
grid on; %[output:93a0347f]

% Subplot 3: Emissions Breakdown by Source
subplot(1,3,3) %[output:93a0347f]
transportPct = globalComparison.Transport_Percent;
homePct = globalComparison.Home_Percent;
otherPct = 100 - transportPct - homePct;

% Your region vs global average
globalAvg = [mean(transportPct), mean(homePct), mean(otherPct)];
yourRegion = [transportPct(myIdx), homePct(myIdx), otherPct(myIdx)];

bar([globalAvg; yourRegion]'); %[output:93a0347f]
set(gca, 'XTickLabel', {'Transport', 'Home Energy', 'Other'}); %[output:93a0347f]
ylabel('Percentage of Total Emissions (%)'); %[output:93a0347f]
title('Emissions Breakdown'); %[output:93a0347f]
grid on; %[output:93a0347f]
%%
%[text] ### Part 2: Calculate Your Transport Emissions
%[text] Using the function you built in Exercise 1: Transportation is typically the largest controllable emissions source. Your choices here have more impact than almost anything else.

% TODO: Customize these values for YOUR typical travel patterns

% Daily Commute
myCommuteMode = 'Car_Gasoline';  % Options: 'Car_Gasoline', 'Car_Electric_BEV', 
                                 %          'Bus', 'Train_Rail', 'Motorcycle',
                                 %          'Cycling', 'Walking'
myDailyCommuteKm = 20;           % One-way distance
myCommuteDays = 250;             % Working days per year

% Air Travel
myDomesticFlights = 2;           % Round trips per year
myAvgDomesticFlightKm = 1500;    % Average distance
myInternationalFlights = 1;      % Round trips per year
myAvgInternationalFlightKm = 8000;  % Average distance

% Other Regular Travel
myOtherTravelKm = 50;            % Errands, weekends (km per week)

% Calculate using your Exercise 1 function
myTransportEmissions = calculateTransportEmissions(...
    myRegion, myCommuteMode, myDailyCommuteKm, myCommuteDays, ...
    myDomesticFlights, myAvgDomesticFlightKm, ...
    myInternationalFlights, myAvgInternationalFlightKm, ...
    myOtherTravelKm);

fprintf('  YOUR TRANSPORT EMISSIONS: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:93518f39] %[output:878acf34]
    myTransportEmissions, myTransportEmissions/1000); %[output:group:93518f39] %[output:878acf34]
fprintf('  Regional Transport Avg: %.1f tons/year\n', ... %[output:group:245792c5] %[output:6f515855]
    myRegionalContext.PerCapita_Total_Tons * myRegionalContext.Transport_Percent/100); %[output:group:245792c5] %[output:6f515855]
%%
%% Visualize: Your Transport Emissions Breakdown

% Calculate component breakdown
commuteEmissionsFactor = getEmissionFactor(myRegion, myCommuteMode);
commuteEmissions = myDailyCommuteKm * 2 * commuteEmissionsFactor * myCommuteDays / 1000;

domesticFlightFactor = 156;  % g/pkm for domestic medium
domesticEmissions = myDomesticFlights * 2 * myAvgDomesticFlightKm * domesticFlightFactor / 1000;

intlFlightFactor = 147;  % g/pkm for international long
intlEmissions = myInternationalFlights * 2 * myAvgInternationalFlightKm * intlFlightFactor / 1000;

otherEmissions = myTransportEmissions - commuteEmissions - domesticEmissions - intlEmissions;

figure('Name', 'Your Transport Story', 'Position', [100 100 1400 600]); %[output:53ceb296]

% Subplot 1: Pie chart of transport breakdown
subplot(2,3,1) %[output:53ceb296]
transportComponents = [commuteEmissions, domesticEmissions, intlEmissions, otherEmissions];
transportLabels = {'Daily Commute', 'Domestic Flights', 'International Flights', 'Other Travel'};
pie(transportComponents, transportLabels); %[output:1cdb1d30] %[output:53ceb296]
title(sprintf('Your Transport Breakdown\nTotal: %.1f tons CO₂', myTransportEmissions/1000)); %[output:53ceb296]
colormap([0.2 0.6 0.8; 0.8 0.4 0.2; 0.9 0.6 0.2; 0.5 0.5 0.5]); %[output:53ceb296]

% Subplot 2: Mode comparison - what if you switched?
subplot(2,3,2) %[output:53ceb296]
alternativeModes = {'Walking', 'Cycling', 'Bus', 'Train_Rail', 'Car_Electric_BEV', 'Car_Gasoline'};
alternativeEmissions = zeros(size(alternativeModes));

for i = 1:length(alternativeModes)
    alternativeEmissions(i) = calculateTransportEmissions(...
        myRegion, alternativeModes{i}, myDailyCommuteKm, myCommuteDays, ...
        0, 0, 0, 0, myOtherTravelKm) / 1000;  % Convert to tons
end

% Highlight current mode
colors = repmat([0.7 0.7 0.7], length(alternativeModes), 1);
currentIdx = strcmp(alternativeModes, myCommuteMode);
colors(currentIdx, :) = [0.2 0.6 0.8];

barh(categorical(alternativeModes), alternativeEmissions, 'FaceColor', 'flat', 'CData', colors); %[output:53ceb296]
xlabel('Annual Emissions (tons CO₂)'); %[output:53ceb296]
title('Mode Switching Impact'); %[output:53ceb296]
grid on; %[output:53ceb296]

% Subplot 3: Flight impact visualization
subplot(2,3,3) %[output:53ceb296]
totalFlightEmissions = domesticEmissions + intlEmissions;
nonFlightEmissions = myTransportEmissions/1000 - totalFlightEmissions;

bar([nonFlightEmissions, totalFlightEmissions; nonFlightEmissions, 0], 'stacked'); %[output:53ceb296]
set(gca, 'XTickLabel', {'Your Total', 'Without Flights'}); %[output:53ceb296]
ylabel('Emissions (tons CO₂/year)'); %[output:53ceb296]
title('Flight Impact on Total'); %[output:53ceb296]
legend({'Ground Transport', 'Flights'}, 'Location', 'best'); %[output:53ceb296]
grid on; %[output:53ceb296]

% Subplot 4: Regional comparison
subplot(2,3,4) %[output:53ceb296]
regionalTransportAvg = myRegionalContext.PerCapita_Total_Tons * myRegionalContext.Transport_Percent/100;
globalTransportAvg = 1.2;  % tons/year global average

bar([myTransportEmissions/1000, regionalTransportAvg, globalTransportAvg]); %[output:53ceb296]
ylabel('Transport Emissions (tons CO₂/year)'); %[output:53ceb296]
title('How You Compare'); %[output:53ceb296]
grid on; %[output:53ceb296]

% Subplot 5: Annualized daily commute visual
subplot(2,3,5) %[output:53ceb296]
dailyCommuteEmissions = myDailyCommuteKm * 2 * commuteEmissionsFactor / 1000;  % kg per day
weeklyEmissions = dailyCommuteEmissions * 5;  % Assuming 5-day work week
monthlyEmissions = commuteEmissions / 12;
annualEmissions = commuteEmissions;

bar([dailyCommuteEmissions, weeklyEmissions, monthlyEmissions, annualEmissions]); %[output:53ceb296]
set(gca, 'XTickLabel', {'Daily', 'Weekly', 'Monthly', 'Annual'}); %[output:53ceb296]
ylabel('Commute Emissions (kg CO₂)'); %[output:53ceb296]
title('Your Commute Over Time'); %[output:53ceb296]
grid on; %[output:53ceb296]

% Subplot 6: Carbon intensity of different distances
subplot(2,3,6) %[output:53ceb296]
distances = [10, 50, 100, 500, 1000];  % km
modesForComparison = {'Car_Gasoline', 'Bus', 'Train_Rail'};
emissionsMatrix = zeros(length(modesForComparison), length(distances));

for i = 1:length(modesForComparison)
    factor = getEmissionFactor(myRegion, modesForComparison{i});
    emissionsMatrix(i, :) = distances * factor / 1000;  % Convert to kg
end

plot(distances, emissionsMatrix', '-o', 'LineWidth', 2); %[output:53ceb296]
xlabel('Distance (km)'); %[output:53ceb296]
ylabel('Emissions (kg CO₂)'); %[output:53ceb296]
title('Emissions by Mode & Distance'); %[output:53ceb296]
legend(modesForComparison, 'Location', 'northwest'); %[output:53ceb296]
grid on; %[output:53ceb296]
%%
%[text] ### Part 3: Calculate Your Home Energy Emissions
%[text] Geography matters most here and your grid determines your impact. Home energy is where regional differences are most dramatic:
%[text] - Norway (hydro grid): 30 g CO₂/kWh
%[text] - India (coal grid): 708 g CO₂/kWh
%[text] - Same appliance, 24x different impact! \
%[text] 

% TODO: Customize these values for YOUR home energy use

% Electricity consumption
myMonthlyElectricityKWh = 900;   % Check your utility bill!
                                 % USA avg: 877 kWh/month
                                 % Europe avg: 300-400 kWh/month
                                 % Varies by climate, home size, appliances

% Heating fuel (if applicable)
myMonthlyNaturalGasKWh = 300;    % For heating (if you use gas)
                                 % Set to 0 if electric/other heating
                                 % USA avg: 500 kWh/month in winter

% Climate context
myClimateZone = 'Temperate';     % Options: 'Tropical', 'Temperate', 'Cold'
myHomeType = 'Apartment';        % Options: 'Apartment', 'Single-Family', 'Townhouse'
myHomeSize_sqm = 100;            % Square meters

% Load home emissions function (provided)
myHomeEmissions = calculateHomeEmissions(myRegion, ...
    myMonthlyElectricityKWh * 12, myMonthlyNaturalGasKWh * 12);

fprintf('  YOUR HOME EMISSIONS: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:643a2b92] %[output:8052bb40]
    myHomeEmissions, myHomeEmissions/1000); %[output:group:643a2b92] %[output:8052bb40]
fprintf('  Regional Home Energy Avg: %.1f tons/year\n', ... %[output:group:2ff4c007] %[output:328735f6]
    myRegionalContext.PerCapita_Total_Tons * myRegionalContext.Home_Percent/100); %[output:group:2ff4c007] %[output:328735f6]

%% Visualize: Your Home Energy Story

figure('Name', 'Your Home Energy Story', 'Position', [100 100 1400 600]); %[output:4c442a40]

% Subplot 1: Monthly energy profile
subplot(2,3,1) %[output:4c442a40]
months = 1:12;
% Simulate seasonal variation (higher in winter/summer depending on climate)
if strcmp(myClimateZone, 'Cold')
    seasonalFactor = 1 + 0.5*cos((months-1)*pi/6);  % Peak in winter
elseif strcmp(myClimateZone, 'Tropical')
    seasonalFactor = 1 + 0.3*cos((months-7)*pi/6);  % Peak in summer (cooling)
else
    seasonalFactor = 1 + 0.2*cos((months-1)*pi/6);  % Mild seasonal variation
end

monthlyElectricity = myMonthlyElectricityKWh * seasonalFactor;
monthlyGas = myMonthlyNaturalGasKWh * seasonalFactor;

bar(months, [monthlyElectricity', monthlyGas'], 'stacked'); %[output:4c442a40]
xlabel('Month'); %[output:4c442a40]
ylabel('Energy Use (kWh)'); %[output:4c442a40]
title('Your Monthly Energy Profile'); %[output:4c442a40]
legend({'Electricity', 'Natural Gas'}, 'Location', 'best'); %[output:4c442a40]
grid on; %[output:4c442a40]
set(gca, 'XTick', 1:12, 'XTickLabel', {'J','F','M','A','M','J','J','A','S','O','N','D'}); %[output:4c442a40]

% Subplot 2: Grid impact - your emissions vs. different grids
subplot(2,3,2) %[output:4c442a40]
gridsToCompare = {'Norway', 'Europe', 'USA', 'China', 'India'};
gridIntensities = [30, 230, 384, 550, 708];  % g CO₂/kWh
emissionsInDifferentGrids = myMonthlyElectricityKWh * 12 * gridIntensities / 1000;  % kg

% Highlight your region
colors = repmat([0.7 0.7 0.7], length(gridsToCompare), 1);
if ismember(myRegion, gridsToCompare)
    myGridIdx = strcmp(gridsToCompare, myRegion);
    colors(myGridIdx, :) = [0.2 0.6 0.8];
end

barh(categorical(gridsToCompare), emissionsInDifferentGrids, 'FaceColor', 'flat', 'CData', colors); %[output:4c442a40]
xlabel('Annual Emissions (kg CO₂)'); %[output:4c442a40]
title(sprintf('Your Electricity Use (%d kWh/year)\nIn Different Grids', myMonthlyElectricityKWh*12)); %[output:4c442a40]
grid on; %[output:4c442a40]

% Subplot 3: Home energy breakdown by end use
subplot(2,3,3) %[output:4c442a40]
% Typical breakdown (adjust based on home type and climate)
if strcmp(myClimateZone, 'Cold')
    endUses = {'Heating', 'Water Heating', 'Appliances', 'Lighting', 'Electronics', 'Cooling'};
    percentages = [35, 20, 20, 10, 10, 5];
elseif strcmp(myClimateZone, 'Tropical')
    endUses = {'Cooling', 'Appliances', 'Water Heating', 'Electronics', 'Lighting', 'Heating'};
    percentages = [30, 25, 15, 15, 10, 5];
else
    endUses = {'Heating/Cooling', 'Water Heating', 'Appliances', 'Electronics', 'Lighting'};
    percentages = [25, 20, 25, 15, 15];
end

pie(percentages, endUses); %[output:4c442a40]
title('Typical Home Energy End Uses'); %[output:4c442a40]
colormap(jet(length(endUses))); %[output:4c442a40]

% Subplot 4: Emissions per square meter comparison
subplot(2,3,4) %[output:4c442a40]
homeTypes = {'Apartment', 'Townhouse', 'Single-Family'};
typicalSizes = [80, 130, 200];  % m²
typicalEmissions = [1800, 2400, 3200];  % kg CO₂/year (varies by region)

% Your home
yourEmissionsPerSqm = myHomeEmissions / myHomeSize_sqm;
typicalEmissionsPerSqm = typicalEmissions ./ typicalSizes;

bar([typicalEmissionsPerSqm, yourEmissionsPerSqm]); %[output:4c442a40]
set(gca, 'XTickLabel', [homeTypes, 'Your Home']); %[output:4c442a40]
ylabel('Emissions per m² (kg CO₂/year/m²)'); %[output:4c442a40]
title('Home Efficiency Comparison'); %[output:4c442a40]
grid on; %[output:4c442a40]

% Subplot 5: Annual cost vs emissions trade-off
subplot(2,3,5) %[output:4c442a40]
% Estimate electricity cost (varies by region)
electricityCostPerKWh = 0.15;  % USD, adjust for region
annualElectricityCost = myMonthlyElectricityKWh * 12 * electricityCostPerKWh;
annualGasCost = myMonthlyNaturalGasKWh * 12 * 0.10;  % USD estimate

totalEnergyCost = annualElectricityCost + annualGasCost;
totalEnergyEmissions = myHomeEmissions;

scatter(totalEnergyCost, totalEnergyEmissions/1000, 200, 'filled'); %[output:4c442a40]
xlabel('Annual Energy Cost (USD)'); %[output:4c442a40]
ylabel('Annual Emissions (tons CO₂)'); %[output:4c442a40]
title('Your Home: Cost vs. Carbon'); %[output:4c442a40]
text(totalEnergyCost*1.05, totalEnergyEmissions/1000, ... %[output:4c442a40]
    sprintf('  You\n  $%.0f/year\n  %.1f tons', totalEnergyCost, totalEnergyEmissions/1000)); %[output:4c442a40]
grid on; %[output:4c442a40]

% Subplot 6: Decarbonization pathways
subplot(2,3,6) %[output:4c442a40]
scenarios = {'Current', 'LED Lighting', '+ Efficient Appliances', ...
             '+ Better Insulation', '+ Solar Panels', '+ Heat Pump'};
emissionReductions = [100, 95, 85, 70, 40, 25];  % Percentage of current
scenarioEmissions = myHomeEmissions/1000 * emissionReductions/100;

barh(categorical(scenarios), scenarioEmissions, 'FaceColor', [0.2 0.6 0.8]); %[output:4c442a40]
xlabel('Annual Emissions (tons CO₂)'); %[output:4c442a40]
title('Home Decarbonization Pathways'); %[output:4c442a40]
grid on; %[output:4c442a40]
%%
%[text] ### Part 4: Calculate Your Food Emissions
%[text] Diet choice is one of the highest-impact decisions you make 3x per day

% TODO: Select your typical diet pattern
myDietType = 'balanced';  % Options: 'meat-heavy', 'balanced', 'vegetarian', 'vegan'

% Load food emissions function (provided)
myFoodEmissions = calculateFoodEmissions(myDietType);

% Display
fprintf('  Your Diet Type: %s\n', myDietType); %[output:44c9dd03]
fprintf('  ────────────────────────────────────────\n'); %[output:81d78eae]
fprintf('  YOUR FOOD EMISSIONS: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:55906073] %[output:054ad64b]
    myFoodEmissions, myFoodEmissions/1000); %[output:group:55906073] %[output:054ad64b]
fprintf('  Global Food Avg: 1.8 tons CO₂/year\n'); %[output:01bc1137]
fprintf('════════════════════════════════════════════════════════════════\n\n'); %[output:11193e76]

%% Visualize: Your Food Impact

figure('Name', 'Your Food Story', 'Position', [100 100 1200 500]); %[output:6170a869]

% Subplot 1: Diet comparison
subplot(1,3,1) %[output:6170a869]
dietTypes = {'vegan', 'vegetarian', 'balanced', 'meat-heavy'};
dietEmissions = zeros(size(dietTypes));
for i = 1:length(dietTypes)
    dietEmissions(i) = calculateFoodEmissions(dietTypes{i}) / 1000;
end

% Highlight your diet
colors = repmat([0.7 0.7 0.7], length(dietTypes), 1);
myDietIdx = strcmp(dietTypes, myDietType);
colors(myDietIdx, :) = [0.2 0.6 0.8];

barh(categorical(dietTypes), dietEmissions, 'FaceColor', 'flat', 'CData', colors); %[output:6170a869]
xlabel('Annual Emissions (tons CO₂)'); %[output:6170a869]
title('Dietary Patterns Comparison'); %[output:6170a869]
grid on; %[output:6170a869]

% Subplot 2: Food category breakdown
subplot(1,3,2) %[output:6170a869]
if strcmp(myDietType, 'meat-heavy')
    categories = {'Beef/Lamb', 'Poultry', 'Pork', 'Dairy', 'Grains/Veg', 'Processed'};
    percentages = [35, 15, 10, 15, 15, 10];
elseif strcmp(myDietType, 'balanced')
    categories = {'Poultry', 'Pork', 'Dairy', 'Grains/Veg', 'Processed', 'Beef/Lamb'};
    percentages = [20, 15, 20, 30, 10, 5];
elseif strcmp(myDietType, 'vegetarian')
    categories = {'Dairy', 'Eggs', 'Grains/Veg', 'Processed', 'Legumes'};
    percentages = [30, 15, 35, 10, 10];
else  % vegan
    categories = {'Grains/Veg', 'Legumes', 'Processed', 'Nuts/Seeds'};
    percentages = [45, 25, 20, 10];
end

pie(percentages, categories); %[output:6170a869]
title(sprintf('Your Food Breakdown\n(%s diet)', myDietType)); %[output:6170a869]

% Subplot 3: Impact of shifting one day per week
subplot(1,3,3) %[output:6170a869]
currentWeekly = myFoodEmissions / 52;  % Per week
dietOptions = {'Current', 'One Vegan Day/Week', 'Two Vegan Days/Week', 'Weekday Veg'};
weeklyReductions = [100, 86, 72, 60];  % Percent of current
modifiedEmissions = currentWeekly * weeklyReductions/100 * 52 / 1000;  % Annual tons

bar(modifiedEmissions, 'FaceColor', [0.2 0.6 0.8]); %[output:6170a869]
set(gca, 'XTickLabel', dietOptions); %[output:6170a869]
ylabel('Annual Emissions (tons CO₂)'); %[output:6170a869]
title('Small Changes, Big Impact'); %[output:6170a869]
grid on; %[output:6170a869]
%%
%[text] ### Part 5: Calculate Your Digital Footprint
%[text] The hidden emissions of our connected lives
% TODO: Estimate your digital usage
myStreamingHoursPerDay = 2;          % Video streaming (Netflix, YouTube, etc.)
myAIQueriesPerDay = 10;              % ChatGPT, Copilot, etc.
myCloudStorageGB = 100;              % Google Drive, Dropbox, iCloud, etc.
myVideoCallHoursPerWeek = 5;         % Zoom, Teams, etc.
myEmailsPerDay = 50;                 % Sent + received

% Load digital emissions function (provided)
myDigitalEmissions = calculateDigitalEmissions(...
    myStreamingHoursPerDay, myAIQueriesPerDay, myCloudStorageGB, ...
    myVideoCallHoursPerWeek, myEmailsPerDay);


fprintf('  YOUR DIGITAL EMISSIONS: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:57fc7f66] %[output:6f712c7b]
    myDigitalEmissions, myDigitalEmissions/1000); %[output:group:57fc7f66] %[output:6f712c7b]
fprintf('  Note: Digital is typically <5%% of total footprint\n'); %[output:2035a089]
%[text] ### Part 6: Calculate Your Consumption Emissions
%[text] Everything we buy has embedded carbon
% TODO: Estimate your consumption patterns
myShoppingFrequency = 'moderate';    % Options: 'minimal', 'moderate', 'frequent'
myClothingPurchases = 10;            % New items per year
myElectronicsPurchases = 1;          % New devices per year
myFurniturePurchases = 0;            % Large items per year

% Load consumption emissions function (provided)
myConsumptionEmissions = calculateConsumptionEmissions(...
    myShoppingFrequency, myClothingPurchases, ...
    myElectronicsPurchases, myFurniturePurchases);

fprintf('  Shopping Pattern: %s\n', myShoppingFrequency); %[output:3a9996e3]
fprintf('  Clothing Purchases: %d items/year\n', myClothingPurchases); %[output:3df373e6]
fprintf('  Electronics: %d devices/year\n', myElectronicsPurchases); %[output:776477a6]
fprintf('  ────────────────────────────────────────\n'); %[output:73067687]
fprintf('  YOUR CONSUMPTION EMISSIONS: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:18441f29] %[output:5197c4ad]
    myConsumptionEmissions, myConsumptionEmissions/1000); %[output:group:18441f29] %[output:5197c4ad]
fprintf('════════════════════════════════════════════════════════════════\n\n'); %[output:41dbb851]

%[text] ### YOUR COMPLETE CARBON STORY
%[text] Bringing it all together:

myTotalEmissions = myTransportEmissions + myHomeEmissions + ...
                   myFoodEmissions + myDigitalEmissions + myConsumptionEmissions;

fprintf('\n');
